// React core
import React from "react";
import { useNavigate } from "react-router-dom";
import '../css/modules/card.css'

// Note the curly braces around props, to allow to prepare to break down the object into individual variables
export default function Card({ data }) {

  const naviagtion = useNavigate()
  // Here is where we do the break down the data
  const { ref, title, server, duration } = data;
  return (
    <div className="grid-item"
      onClick={() => { naviagtion(`../page/${ref}`); window.scrollTo({ top: 0, behavior: 'smooth' }) }}
    >
      <section className="box feature">
        <img 
          className="image featured non-overlay atfib"

          src={`//${server}.mxdcontent.net/thumbs/${ref}.jpg`} alt={title} loading="lazy" />

        <div id="span-case">
          <h3 class="meta-data-title">
            <a href={`../page/${ref}`} class="click-trigger">{title}</a>
          </h3>
          <span class="icon fa-clock-o meta-data">{~~(duration / 60)}m {duration % 60}s</span>
        </div>
      </section>
    </div>
  );
}
